import React from 'react';
import '../../App.css';
import SimpleSlider from '../Slider';
import About from '../About';
import Navbar from './components/Navbar';
import HeroSection from '../HeroSection';

function Home() {
  return (
    <>
      <Navbar />
      <SimpleSlider />
    </>
  );
}

export default Home;
